package model.Element;import contract.*;/** * The class Element * @author Tanguy Blochet * @version 15.06.2016 */public class Element implements IElement {    private ISprite sprite;    private Permeability permeability;    private StateElement stateElement;    public Element(ISprite sprite, Permeability permeability,StateElement stateElement) {        this.sprite = sprite;        this.permeability = permeability;        this.stateElement = stateElement;    }    public ISprite getSprite() {        return this.sprite;    }    public void setSprite(ISprite sprite) {    this.sprite=sprite;    }    public Permeability getPermeability() {        return this.permeability;    }    public void setPermeability(Permeability permeability) {        this.permeability = permeability;    }    public StateElement getStateElement() {        return this.stateElement;    }    public void setStateElement(StateElement stateElement) {        this.stateElement = stateElement;    }}